func rd() {

	/*
			–°–æ–∑–¥–∞—ë—Ç—Å—è –æ–±—ä–µ–∫—Ç reader —Ç–∏–ø–∞ *strings.Reader, –∫–æ—Ç–æ—Ä—ã–π –ø–æ–∑–≤–æ–ª—è–µ—Ç —á–∏—Ç–∞—Ç—å —Å—Ç—Ä–æ–∫—É "SAMPLE" –∫–∞–∫ –ø–æ—Ç–æ–∫ –±–∞–π—Ç–æ–≤.
		    –≠—Ç–æ –ø–æ—Ö–æ–∂–µ –Ω–∞ –æ—Ç–∫—Ä—ã—Ç–∏–µ —Ñ–∞–π–ª–∞ –∏–ª–∏ –ø–æ—Ç–æ–∫–∞, –Ω–æ –¥–∞–Ω–Ω—ã–µ –±–µ—Ä—É—Ç—Å—è –∏–∑ —Å—Ç—Ä–æ–∫–∏.
	*/
	reader := strings.NewReader("SAMPLE")
	/*
			–°–æ–∑–¥–∞—ë—Ç—Å—è –æ–±—ä–µ–∫—Ç newString –¥–ª—è —ç—Ñ—Ñ–µ–∫—Ç–∏–≤–Ω–æ–π –ø–æ—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª—å–Ω–æ–π –∑–∞–ø–∏—Å–∏ —Å—Ç—Ä–æ–∫ –∏–ª–∏ –±–∞–π—Ç–æ–≤.
		    –í –∫–æ–Ω—Ü–µ –º—ã –∏—Å–ø–æ–ª—å–∑—É–µ–º –µ–≥–æ, —á—Ç–æ–±—ã —Å–æ–±—Ä–∞—Ç—å –ø—Ä–æ—á–∏—Ç–∞–Ω–Ω—ã–µ –¥–∞–Ω–Ω—ã–µ –≤ –æ–¥–Ω—É —Å—Ç—Ä–æ–∫—É.
	*/
	var newString strings.Builder

	/*
			–°–æ–∑–¥–∞—ë—Ç—Å—è –æ–±—ä–µ–∫—Ç newString –¥–ª—è —ç—Ñ—Ñ–µ–∫—Ç–∏–≤–Ω–æ–π –ø–æ—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª—å–Ω–æ–π –∑–∞–ø–∏—Å–∏ —Å—Ç—Ä–æ–∫ –∏–ª–∏ –±–∞–π—Ç–æ–≤.
		    –í –∫–æ–Ω—Ü–µ –º—ã –∏—Å–ø–æ–ª—å–∑—É–µ–º –µ–≥–æ, —á—Ç–æ–±—ã —Å–æ–±—Ä–∞—Ç—å –ø—Ä–æ—á–∏—Ç–∞–Ω–Ω—ã–µ –¥–∞–Ω–Ω—ã–µ –≤ –æ–¥–Ω—É —Å—Ç—Ä–æ–∫—É.
	*/
	buffer := make([]byte, 4)

	for {
		/*
			–≤—ã–∑—ã–≤–∞–µ—Ç—Å—è –º–µ—Ç–æ–¥ Read —É reader, –∫–æ—Ç–æ—Ä—ã–π –ø—ã—Ç–∞–µ—Ç—Å—è –ø—Ä–æ—á–∏—Ç–∞—Ç—å –¥–æ 4 –±–∞–π—Ç
			(—Ä–∞–∑–º–µ—Ä –±—É—Ñ–µ—Ä–∞) –∏–∑ —Å—Ç—Ä–æ–∫–∏ "SAMPLE".
		*/
		numBytes, err := reader.Read(buffer)
		/*
			—Å—Ä–µ–∑ –±—É—Ñ—Ñ–µ—Ä–∞ numBytes - –∫–æ–ª–≤–æ –ø—Ä–æ—á–∏—Ç–∞–Ω–Ω—ã—Ö –±–∞–π—Ç (–µ—Å–ª–∏ –ø—Ä–æ—á–∏—Ç–∞–Ω–æ 4 –±–∞–π—Ç —Ç–æ numBytes
			–±—É–¥–µ—Ç 4, –µ—Å–ª–∏ –º–µ–Ω—å—à–µ - —Ç–æ –º–µ–Ω—å—à–µ)
		*/
		chunk := buffer[:numBytes]
		/*
			newString.Write(chunk) - –∑–∞–ø–∏—Å—ã–≤–∞–µ–º –ø—Ä–æ—á–∏—Ç–∞–Ω–Ω—ã–µ –±–∞–π—Ç—ã –≤ strings.Builder
		*/
		newString.Write(chunk)
		/*
			–ü–µ—á–∞—Ç–∞–µ–º –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ –ø—Ä–æ—á–∏—Ç–∞–Ω—ã—Ö –±–∞–π—Ç –∏ –±–∞–π—Ç—ã
		*/
		fmt.Printf("Read %v bytes: %c\n", numBytes, chunk)

		//–ï—Å–ª–∏ –¥–æ—Å—Ç–∏–≥–Ω—É—Ç –∫–æ–Ω–µ—Ü –¥–∞–Ω–Ω—ã—Ö –ø—Ä–µ—Ä—ã–≤–∞–µ–º —Ü–∏–∫–ª
		if err == io.EOF {
			break
		}
	}
	fmt.Printf(" %v \n", newString.String())
}

