		    –¥–∞–Ω–Ω—ã–µ –∏–∑ —Å—Ç—Ä–æ–∫–∏ "SAMPLE" –∫–∞–∫ –∏–∑ –ø–æ—Ç–æ–∫–∞ –±–∞–π—Ç–æ–≤
	*/
	source := strings.NewReader("SAMPLE")

	/*
		–û–±–æ—Ä–∞—á–∏–≤–∞–Ω–∏–µ –≤ –±—É—Ñ–µ—Ä–∏–∑–∏—Ä–æ–≤–∞–Ω–Ω—ã–π —Ä–∏–¥–µ—Ä bufio.NewReader(source)
		—Å–æ–∑–¥–∞—ë—Ç –±—É—Ñ–µ—Ä–∏–∑–∏—Ä–æ–≤–∞–Ω–Ω—ã–π —Ä–∏–¥–µ—Ä, –∫–æ—Ç–æ—Ä—ã–π –æ–±–æ—Ä–∞—á–∏–≤–∞–µ—Ç –∏—Å—Ö–æ–¥–Ω—ã–π io.Reader.
		–≠—Ç–æ –ø–æ–∑–≤–æ–ª—è–µ—Ç —á–∏—Ç–∞—Ç—å –¥–∞–Ω–Ω—ã–µ –±–æ–ª–µ–µ —ç—Ñ—Ñ–µ–∫—Ç–∏–≤–Ω–æ –∏ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –¥–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω—ã–µ
		–º–µ—Ç–æ–¥—ã, —Ç–∞–∫–∏–µ –∫–∞–∫ ReadString
