		–ø–µ—Ä–≤–æ–≥–æ –≤—Ö–æ–∂–¥–µ–Ω–∏—è —Å–∏–º–≤–æ–ª–∞ –Ω–æ–≤–æ–π —Å—Ç—Ä–æ–∫–∏ '\n' (–≤–∫–ª—é—á–∞—è —Å–∞–º —Å–∏–º–≤–æ–ª).
		–ï—Å–ª–∏ —Å–∏–º–≤–æ–ª '\n' –Ω–∞–π–¥–µ–Ω, —Ñ—É–Ω–∫—Ü–∏—è –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç —Å—Ç—Ä–æ–∫—É –¥–æ –∏ –≤–∫–ª—é—á–∞—è —ç—Ç–æ—Ç —Å–∏–º–≤–æ–ª, –∞ err == nil.
		–ï—Å–ª–∏ —Å–∏–º–≤–æ–ª '\n' –Ω–µ –Ω–∞–π–¥–µ–Ω –∏ –¥–æ—Å—Ç–∏–≥–Ω—É—Ç –∫–æ–Ω–µ—Ü –ø–æ—Ç–æ–∫–∞, —Ñ—É–Ω–∫—Ü–∏—è –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç –≤—Å–µ
		–¥–æ—Å—Ç—É–ø–Ω—ã–µ –¥–∞–Ω–Ω—ã–µ –∏ –æ—à–∏–±–∫—É io.EOF.
	*/
	newString, err := buffered.ReadString('\n')
	if err == io.EOF {
		fmt.Println(newString)
	} else {
		fmt.Println("something went wrong...")
	}

}


func bfosearch() {
	// Read lines from standard input
	//1. –°–æ–∑–¥–∞–Ω–∏–µ —Å–∫–∞–Ω–µ—Ä–∞ –¥–ª—è —á—Ç–µ–Ω–∏—è –∏–∑ —Å—Ç–∞–Ω–¥–∞—Ä—Ç–Ω–æ–≥–æ –≤–≤–æ–¥–∞
	scanner := bufio.NewScanner(os.Stdin)
	//2. –°–æ–∑–¥–∞–Ω–∏–µ —Å—Ä–µ–∑–∞ –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è —Å—Ç—Ä–æ–∫
	lines := make([]string, 0, 5)

	//–ü–æ–∫–∞ –∏–¥–µ—Ç –≤–≤–æ–¥
	for scanner.Scan() {
		lines = append(lines, scanner.Text())
	}

	//–ï—Å–ª–∏ –ø—Ä–æ–∏–∑–æ—à–ª–∞ –æ—à–∏–±–∫–∞
	if scanner.Err() != nil {
		fmt.Println(scanner.Err())
	}
    //–°–∫–æ–ª—å–∫–æ –ª–∏–Ω–∏–π –ø—Ä–æ—á–∏—Ç–∞–Ω–æ
	fmt.Printf("Line count: %v\n", len(lines))

	//–ü–µ—á–∞—Ç—å –ª–∏–Ω–∏–π
	for _, line := range lines {
		fmt.Printf("Line: %v\n", line)
	}

}

