func bfread() {
	//–°–æ–∑–¥–∞–Ω–∏–µ –Ω–æ–≤–æ–≥–æ –±—É—Ñ–µ—Ä–∞
	buffer := bytes.NewBufferString("")
	//–ó–∞–ø–∏—Å–∞—Ç—å –≤ –±—É—Ñ—Ñ–µ—Ä
	numBytes, err := buffer.WriteString("SAMPLE")
	if err != nil {
		fmt.Println(err)
	} else {
		fmt.Printf("Wrote %v bytes: %c\n", numBytes, buffer)
	}
}

