                        PrintAllPlayers();
                        break;

                    case ExitProgramCommand:
                        isWorking = false;
                        break;

                    default:
                        Console.WriteLine("–ù–µ–≤–µ—Ä–Ω—ã–π –≤—ã–±–æ—Ä. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –µ—â–µ —Ä–∞–∑.");
